import * as React from "react";
import "../css/register.css";
import "./reusable/form";

interface RegisterProps {}

const Register: React.FunctionComponent<RegisterProps> = () => {
  return (
    <div className="registerForm">
      <form>
        <h3>Sign Up</h3>
      </form>
    </div>
  );
};

export default Register;
